import App from '../../App';
import './Comments.scss';

function Comments(props) {
    return (
    <>
        <div className="comments__container">
            <div className="comments__icon-container">
                <div className="comments__icon"></div>
            </div>
                        
            <div className="comments__date-container">
                <p className="comments__name">Michael Lyons</p>
                <p className="comments__date">12/18/2018</p>
            </div>

            <div className="comments__text-container">
                <p className="comments__post">They BLEW the ROOF off at their 
                last show, once everyone started 
                figuring out they were going. This is 
                still simply the greatest opening of a 
                concert I have EVER witnessed.</p>
            </div>
        </div>
    </>
    );
}

export default Comments;
